import React from "react";

export default class Test extends React.Component{
   constructor(props){
       super(props);
       this.state = {
           helloCounter:0,
       };
   }

   increHello(){
       this.setState({helloCounter:this.state.helloCounter+1});
   }
    render(){
    return (
        <div>

            <button className = "hello_button" onClick = {() => {this.increHello()}}>こんにちは!</button>
            <p className = "hello_counter">{this.state.helloCounter}</p>
            </div>
            );
    }
}
